### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Demand and Pricing**
- **Latent Demand**: Area under the demand-response curve when the price is reduced below the optimal price.
- **Demand Function**: \( D(p) = 720 - 5P \)
- **Profit Maximization**: Optimal selling price when cost per unit is given.

#### 2. **Logistic Regression**
- **Objective Function**: Maximization of log-likelihood.
- **Applications**: Predicting binary outcomes, multi-class outputs, and odds of event occurrence.
- **Multicollinearity**: Refers to the situation where independent variables are highly correlated.

#### 3. **Regression Analysis**
- **Degrees of Freedom**: For residuals in ANOVA table, total degrees of freedom in a model.
- **Adjusted R-square**: Used to compare models with different numbers of predictors.
  \[
  \text{Adjusted } R^2 = 1 - \left( \frac{(1 - R^2)(n - 1)}{n - k - 1} \right)
  \]
  where \( n \) is the number of observations and \( k \) is the number of predictors.

#### 4. **Confusion Matrix and Performance Metrics**
- **Accuracy**:
  \[
  \text{Accuracy} = \frac{TP + TN}{TP + TN + FP + FN}
  \]
- **Precision**:
  \[
  \text{Precision} = \frac{TP}{TP + FP}
  \]
- **Recall (Sensitivity)**:
  \[
  \text{Recall} = \frac{TP}{TP + FN}
  \]
- **Specificity**:
  \[
  \text{Specificity} = \frac{TN}{TN + FP}
  \]

#### 5. **Data Envelopment Analysis (DEA)**
- **Efficient Frontier**: Boundary that defines the set of efficient Decision Making Units (DMUs).
- **Inputs and Outputs**: Understanding the efficient frontier based on inputs and outputs.

#### 6. **Linear Programming (LP)**
- **Primal and Dual Formulations**: Understanding constraints and decision variables.
- **Objective Function Coefficients**: Corresponding to constraints in the primal problem.

